  console.log(countPawnsOnBoard);
  if (countPawnsOnBoard === 0) {
    if (diceThrow === 6) {
      console.log("STARTING THROW");
      HandleStart6Throw();
    }
  } else {
    if (diceThrow === 6) {
      console.log("START");
      console.log("1");
      await Thrown6AndPawnsOnBoard();
      console.log("3");
      console.log("END");
